import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Home from './component/Home';
import SiparisFormu from './component/SiparisFormu';
import SiparisOnayi from './component/SiparisOnayi';

const App = () => {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={Home} />
        <Route path="/siparis-formu" component={SiparisFormu} />
        <Route path="/siparis-alindi" component={SiparisOnayi} />
      </Switch>
    </Router>
  );
};

export default App;
